import React from 'react';
import { Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';

var sectionStyle = {
   
    height: "400rem",
    backgroundRepeat: "noRepeat",
    backgroundImage: "url("+`https://images.pexels.com/photos/443383/pexels-photo-443383.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500` + ")"
    
  };
class HomePage extends React.Component {
    
    render(){
        return(
            <div style = {{ margin: '5rem',sectionStyle}}>
                <Grid
                
                container
                direction="row"
                justify="center"
                 alignItems="center"
                >

                </Grid>
            </div>

        )
    }

}
export default HomePage;
